const { ipcRenderer } = require('electron');
let idleTime,idleWarn,sessionTime,sessionTimerInterval,loginStatus,loginMusic,midiOnce;

//windows xp sounds
let noticeAudioFile = dataURItoBlob('data:file/wav;base64,')
let screenshotAudioFile = dataURItoBlob('data:file/wav;base64,');

