//convert data URI to blob for webfont/audio loading
function dataURItoBlob(dataURI) {
  const [meta, base64] = dataURI.split(',');
  const mimeMatch = meta.match(/data:(.*?);base64/);
  const mime = mimeMatch ? mimeMatch[1] : '';
  const binaryString = atob(base64);
  const len = binaryString.length;
  const bytes = new Uint8Array(len);

  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }

  return new Blob([bytes], { type: mime });
}

//helper function to output time difference for session timer
function getDateDifferenceAsHHMMSS(date1, date2) {
  let diffMilliseconds = Math.abs(date2 - date1);
  let totalSeconds = Math.floor(diffMilliseconds / 1000);
  const hours = Math.floor(totalSeconds / 3600);
  totalSeconds %= 3600;
  const minutes = Math.floor(totalSeconds / 60);
  const seconds = totalSeconds % 60;
  const addLeadingZero = (num) => (num < 10 ? `0${num}` : num);
  const formattedHours = addLeadingZero(hours);
  const formattedMinutes = addLeadingZero(minutes);
  const formattedSeconds = addLeadingZero(seconds);

  return `${formattedHours}:${formattedMinutes}:${formattedSeconds}`;
}

//wrap sockets to track their readystate for the idle timer and session timer
let sockets = [];
const originalSend = WebSocket.prototype.send;
WebSocket.prototype.send = function(...args) {
    if (sockets.indexOf(this) === -1) {
        this.established = new Date();
        sockets.push(this);
    }
    return originalSend.call(this, ...args);
};

//add client global for login functionality
//idea taken from https://pastebin.com/aHD2scKV tampermonkey login script by LR2004
var observer = new MutationObserver(function(mutations) {
  mutations.forEach(function(mutation) {
    mutation.addedNodes.forEach(function(addedNode) {
        if(addedNode.nodeName === 'HEAD'){
            //load custom css and fonts
            const style = document.createElement('style');
            style.textContent = css;
            document.head.appendChild(style);
        }

         if(addedNode.innerText && addedNode.innerText.includes('Client')) {
            addedNode.innerText = addedNode.innerText.replace('new Client(','window.LCClient = new Client(').replace(/[\r\n]/g, '');
            observer.disconnect(); //stop observing after we find the client and modify it
         }
    });
  });
});
observer.observe(document, { childList: true, subtree: true });

//post dom load
window.addEventListener('DOMContentLoaded', () => {

    //send canvas size to main process for resizing the window to keep aspect ratio
    let canvas = document.querySelector('#game canvas');
    const sendSize = () => ipcRenderer.send('resize-to-client', window.innerHeight, canvas.offsetHeight);
    window.addEventListener('resize', sendSize)
    sendSize();

    //preload audio
    let noticeAudio = new Audio(`${URL.createObjectURL(noticeAudioFile)}`);
    noticeAudio.preload = 'auto';
    let screenshotAudio = new Audio(`${URL.createObjectURL(screenshotAudioFile)}`);
    screenshotAudio.preload = 'auto';

    //status bar frame
    const statusBarFrame = document.createElement('div');
    statusBarFrame.classList.add('status-frame');
    document.body.appendChild(statusBarFrame);
    const statusBar = document.createElement('div');
    statusBar.classList.add('status-bar');
    statusBarFrame.appendChild(statusBar);

    function updateStatusMessage(message, timeout = 5000){
        statusBar.innerText = message;
        statusBar.title = message;

        setTimeout(() => {
            if(statusBar.innerText === message){
                statusBar.textContent = '';
                statusBar.title = '';
            }
        }, timeout);
    }

    setInterval(() => {
        if (sockets.some(socket => socket.readyState === WebSocket.OPEN)) {
            ipcRenderer.send('client-logged-in',true);
            loginStatus = true;
        }else{
            ipcRenderer.send('client-logged-in',false);
            loginStatus = false;
        }
    }, 600);

    //idle timer
    const idleTimer = document.createElement('div');
    idleTimer.classList.add('idle-timer', 'status-right');
    idleTimer.innerText = '90';
    idleTimer.title = 'Idle Timer';
    statusBarFrame.appendChild(idleTimer);

    idleTime = 90;
    setInterval(() => {
        if (sockets.some(socket => socket.readyState === WebSocket.OPEN)) idleTime--;
        else idleTime = 90;

        idleTimer.innerText = idleTime>0?idleTime.toString().padStart(2, '0'):'00';
        if(idleWarn > 0 && idleTime <= idleWarn){
            idleTimer.classList.add('flash');
            updateStatusMessage(`You're about to be logged out!`);
        } else idleTimer.classList.remove('flash');
        if(idleWarn > 0 && idleTime == idleWarn) noticeAudio.play();
    }, 1000);

    //events which constitute "activity" for the idle timer
    //not totally sure if all of these events actually work, still need to test them all
    ['mousemove', 'click', 'keydown', 'keyup', 'contextmenu', 'dblclick', 'drag'].forEach(e => {
        canvas.addEventListener(e, () => {
            idleTime = 90;
            idleTimer.classList.remove('flash');
            idleTimer.innerText = idleTime.toString();
        });
    })

    //session timer
    const sessionTimer = document.createElement('div');
    sessionTimer.classList.add('session-timer', 'status-right');
    sessionTimer.title = 'Session Timer';
    statusBarFrame.appendChild(sessionTimer);

    //need to reinit the session timer when option changes between ticks and time because they have different intervals
    function startSessionTimer(){
        if(sessionTimerInterval) clearInterval(sessionTimerInterval);
        sessionTimerInterval = setInterval(() => {
            if (sockets.some(socket => socket.readyState === WebSocket.OPEN)) {
                if(sessionTime == 'ticks'){
                    sessionTimer.innerText = parseInt((new Date() - sockets.find(s => s.readyState === WebSocket.OPEN).established) / 600);
                }else if(sessionTime == 'time'){
                    sessionTimer.innerText = getDateDifferenceAsHHMMSS(sockets.find(s => s.readyState === WebSocket.OPEN).established, new Date());
                }
            }else{
                sessionTimer.innerText = sessionTime == 'ticks'?'0':'00:00:00';
            }
        }, sessionTime == 'ticks'?600:1000);
    }

    //listen for messages from main process
    ipcRenderer.on('client-message', function (event, message) {
        if(message.IdleTimer !== undefined){
            idleTimer.style.display = message.IdleTimer!==false?'block':'none';
            idleWarn = message.IdleTimer;
        }
        if(message.SessionTimer !== undefined){
            sessionTimer.innerText = '';
            sessionTimer.style.display = message.SessionTimer!==false?'block':'none';
            sessionTime = message.SessionTimer;
            startSessionTimer();
        }
        if(message.playScreenshotAudio !== undefined){
            screenshotAudio.play();
        }
        if(message.statusMessage !== undefined){
            updateStatusMessage(message.statusMessage, message.timeout);
        }
        if(message.LoginMusic !== undefined){
            loginMusic = message.LoginMusic;
            const interval = setInterval(() => {
                if (typeof window._tinyMidiVolume === 'function') {
                    clearInterval(interval);

                    if(!midiOnce){
                        const originalMidiVolume = window._tinyMidiVolume;
                        window._tinyMidiVolume = (v) => {
                            if(!loginMusic && !loginStatus) originalMidiVolume(0);
                            else originalMidiVolume(v);
                        }
                        midiOnce = true;
                    }
                    
                    if (message.LoginMusic) window._tinyMidiVolume(Math.pow(10, -4 / 20));
                    else window._tinyMidiVolume(0);
                }
            }, 100)
        }
    });

    //tell main process to send stored settings
    ipcRenderer.send('send-stored-values');

    //accept login info from main process
    ipcRenderer.on('client-login', function (event, acc) {
        window.LCClient.login(acc.username, acc.decryptedPassword)
    });

})